heapless requires no setup as its collections don't depend on a global memory allocator. Just use its collections and proceed to instantiate them: extern crate heapless; // v0.4.x use heapless::Vec;
use heapless::consts::*; #[entry]
fn main() -> ! { let mut xs: Vec<_, U8> = Vec::new(); xs.push(42).unwrap(); assert_eq!(xs.pop(), Some(42));
} You'll note two differences between these collections and the ones in alloc . First, you have to declare upfront the capacity of the collection. heapless collections never reallocate and have fixed capacities; this capacity is part of the type signature of the collection. In this case we have declared that xs has a capacity of 8 elements that is the vector can, at most, hold 8 elements. This is indicated by the U8 (see typenum ) in the type signature. Second, the push method, and many other methods, return a Result . Since the heapless collections have fixed capacity all operations that insert elements into the collection can potentially fail. The API reflects this problem by returning a Result indicating whether the operation succeeded or not. In contrast, alloc collections will reallocate themselves on the heap to increase their capacity. As of version v0.4.x all heapless collections store all their elements inline. This means that an operation like let x = heapless::Vec::new(); will allocate the collection on the stack, but it's also possible to allocate the collection on a static variable, or even on the heap ( Box<Vec<_, _>> ).
